import { useState, useEffect } from 'react';
const Client = () => {
  const [datas, setDatas] = useState(null);

  useEffect(() => {
    fetch('http://localhost:4000/api/data')
      .then((response) => response.json())
      .then((content) => setDatas(content));
  }, []);
  return (
    <div>
      <h2>임시</h2>
      {datas}
      {/* {datas.map((data) => {
        <div key={data.id}>
          <div>{data.id}</div>
          <div>{data.title}</div>
        </div>;
      })} */}
    </div>
  );
};
export default Client;
